import React, { Component } from "react";
class Main extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Travel Planner</h1>
        <form>
          <label>
            City:
            <input type="text" name="city" />
          </label>
          <input classname="btn" type="submit" value="Submit" />
        </form>
      </div>
    );
  }
}

export default Main;
